# The name of library
library_name: mobilenet
target_abis: [arm64-v8a]
model_graph_format: file
model_data_format: file
models:
  shufflenet: # model tag, which will be used in model loading and must be specific.
    platform: onnx
    # path to your onnx model file. Support local path, http:// and https://
    model_file_path: /home/bcpark/csc766-project/onnx_models/shufflenet_opt.onnx
    # sha256_checksum of your model's onnx file.
    # use this command to get the sha256_checksum: sha256sum path/to/your/pb/file
    model_sha256_checksum: 63d5d81528ab76b959c4ab708038b4a3d9e7876ddcf63a06063e476faf29ef8e
    # define your model's interface
    # if there multiple inputs or outputs, write like blow:
    # subgraphs:
    # - input_tensors:
    #     - input0
    #     - input1
    #   input_shapes:
    #     - 1,224,224,3
    #     - 1,224,224,3
    #    output_tensors:
    #      - output0
    #      - output1
    #    output_shapes:
    #      - 1,1001
    #      - 1,1001
    subgraphs:
      - input_tensors:
          - input
        input_shapes:
          - 1,224,224,3
        output_tensors:
          - output
        output_shapes:
          - 1,1001
        # onnx backend framwork for validation. Suppport pytorch/caffe/tensorflow. Default is tensorflow.
        backend: tensorflow
    # cpu, gpu or cpu+gpu
    runtime: cpu+gpu
    winograd: 0